import './BarraPesquisa.css';

function BarraPesquisa(){
    
    return(
        <div className="BarraPesquisa">
            <input />
            <select>
               <option><input type='checkbox'></input></option>
            </select>
        </div>
    )
}
export default BarraPesquisa;
